import React from "react";
import { StyleSheet, Text, View } from "react-native";

const FlexboxScreen = () => {
    return (
        <View style={{
            backgroundColor: "#EE0E37",
            flex: 1,
            flexDirection: "column"
        }}>
            <View
                style={{
                    backgroundColor: "#EE0E37",
                    width: "100%",
                    height: 60,
                    flexDirection: "row-reverse"
                }}>
                <View
                    style={{
                        backgroundColor: "#EE0ED5",
                        width: "10%",
                        height: 60
                    }}
                ></View>
                <View
                    style={{
                        backgroundColor: "#97A395",
                        width: "10%",
                        height: 60
                    }}
                ></View>
                <View
                    style={{
                        backgroundColor: "#DE316",
                        width: "20%",
                        height: 60,
                    }}
                ></View>
            </View>
            <View
                style={{
                    backgroundColor: "#6495ED",
                    width: "100%",
                    height: 75,
                    flexDirection: "row"
                }}
            >
                <View
                    style={{
                        backgroundColor: "#40E0D0",
                        width: "20%",
                        height: 75
                    }}
                ></View>
                <View
                    style={{
                        backgroundColor: "#CD5C5C",
                        width: "20%",
                        height: 75
                    }}
                ></View>
                <View
                    style={{
                        backgroundColor: "#FFA07A",
                        width: "20%",
                        height: 75
                    }}
                ></View>
                <View
                    style={{
                        backgroundColor: "#2C37EC",
                        width: "20%",
                        height: 75
                    }}
                ></View>
                <View
                    style={{
                        backgroundColor: "#ECE62C",
                        width: "20%",
                        height: 75
                    }}
                ></View>
            </View>
            <View
                style={{
                    backgroundColor: "#EE0E37",
                    width: "100%",
                    height: 60
                }}
            ></View>
            <View
                style={{
                    backgroundColor: "#2AEE0E",
                    width: "100%",
                    height: "30%"
                }}
            ></View>
            <View
                style={{
                    backgroundColor: "#EE0E37",
                    width: "100%",
                    height: 60
                }}
            ></View>
            <View
                style={{
                    backgroundColor: "#2AEE0E",
                    flex: 1,
                    width: "100%",
                    height: "50%"
                }}
            ></View>
        </View>

    );
};
export default FlexboxScreen;
const style = StyleSheet.create({});
